function parseStyleString(str) {
    return str
        .split(';')
        .map(part => {
            const [ key, value ] = part.split(':')
            return { key: camelCase(key), value }
        })
        .reduce((obj, prop) => ({
            ...obj,
            [prop.key]: prop.value
        }))
}

function camelCase(str) {
    return str.replace(/-([a-z])/g, function (g) { return g[1].toUpperCase(); });
}
